def is_valid(sweetness, target, K):
    minisum = 0
    count = 0
    minimax = float('inf')
    for x in sweetness:
        minisum = minisum + x
        if minisum >= target:
            if minisum < minimax:
                minimax = minisum
            minisum = 0
            count = count + 1
            if count == K + 1:
                return minimax
    return None


def maximizeSweetness(sweetness, K):
    size = len(sweetness)
    if size == 0:
        return 0
    least, total = float('inf'), 0
    for x in sweetness:
        if x < least:
            least = x
        total = total + x
    start, end = least, int(total / (K + 1)) + 1
    ans = start
    while start <= end:
        mid = int((start + end) / 2)
        sweet = is_valid(sweetness, mid, K)
        if sweet is not None:
            start = mid + 1
            ans = sweet
        else:
            end = mid - 1

    return ans


